    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Bitter Lake NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Bitter Lake NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a description of Refuge resources, legal
    guidelines, the Bitter Lake NWR Management Program, and management strategies by
    tract. Key planning issues include: restoration of native habitats, restoration
    of hydrological systems, public use, cultural resources, strengthening interagency
    relationships, and funding.",nt"license_title": "License Not Specified",nt"extras":
